import React from "react";
import IndexNavbar from "components/Navbars/IndexNavbar.js";
import Footerr from "components/Footers/Footerr";

import ticketBg from "../assets/img/ticket-bg.jpg";
import supportIcon from "../assets/img/support-icon.png";

function NewTicketForm() {
  return (
    <>
      <IndexNavbar />

      <div style={{ ...pageWrapper, backgroundImage: `url(${ticketBg})` }}>
        <div style={overlay} />

        <div style={ticketCard}>
          <div style={headerSection}>
            <div style={{ display: "flex", alignItems: "center", gap: "1rem" }}>
              <img src={supportIcon} alt="support" style={iconStyle} />
              <h1 style={titleStyle}>Nouveau Ticket STB</h1>
            </div>
            <button style={returnButtonStyle}>← Retour</button>
          </div>

          <div style={formSection}>
            <div style={inputGroup}>
              <label style={labelStyle}>📝 Sujet</label>
              <input
                type="text"
                placeholder="Ex: Problème d'accès au compte"
                style={inputStyle}
              />
            </div>

            <div style={inputGroup}>
              <label style={labelStyle}>🏢 Département</label>
              <select style={selectStyle}>
                <option>IT - Informatique</option>
                <option>RH - Ressources Humaines</option>
                <option>Comptabilité</option>
              </select>
            </div>

            <div style={inputGroup}>
              <label style={labelStyle}>📄 Description</label>
              <textarea
                rows="5"
                placeholder="Expliquez votre problème ici..."
                style={textareaStyle}
              />
            </div>

            <div style={createButtonContainer}>
              <button style={createButtonStyle}>📨 Envoyer</button>
            </div>
          </div>
        </div>
      </div>

      <Footerr />
    </>
  );
}

// Styles
const pageWrapper = {
  minHeight: "100vh",
  padding: "3rem 1rem",
  backgroundSize: "cover",
  backgroundPosition: "center",
  display: "flex",
  alignItems: "center",
  justifyContent: "center",
  position: "relative",
};

const overlay = {
  position: "absolute",
  top: 0,
  left: 0,
  right: 0,
  bottom: 0,
  background: "rgba(255,255,255,0.85)",
  zIndex: 1,
};

const ticketCard = {
  background: "#fff",
  borderRadius: "16px",
  boxShadow: "0 10px 30px rgba(0,0,0,0.1)",
  padding: "2.5rem 3rem",
  width: "100%",
  maxWidth: "700px",
  zIndex: 2,
  position: "relative",
};

const headerSection = {
  display: "flex",
  justifyContent: "space-between",
  alignItems: "center",
  marginBottom: "2rem",
};

const iconStyle = {
  width: "40px",
  height: "40px",
};

const titleStyle = {
  fontSize: "1.9rem",
  fontWeight: "700",
  color: "#1a237e",
};

const returnButtonStyle = {
  padding: "0.6rem 1.2rem",
  backgroundColor: "#eeeeee",
  color: "#0d47a1",
  border: "1px solid #ccc",
  borderRadius: "6px",
  cursor: "pointer",
  fontWeight: "600",
  transition: "all 0.2s ease-in-out",
};

const formSection = {
  display: "flex",
  flexDirection: "column",
  gap: "1.5rem",
};

const inputGroup = {
  display: "flex",
  flexDirection: "column",
};

const labelStyle = {
  fontWeight: "600",
  marginBottom: "0.5rem",
  color: "#333",
};

const inputStyle = {
  padding: "0.9rem",
  border: "1px solid #ccc",
  borderRadius: "6px",
  fontSize: "1rem",
};

const selectStyle = {
  ...inputStyle,
  backgroundColor: "#fff",
  cursor: "pointer",
};

const textareaStyle = {
  ...inputStyle,
  resize: "vertical",
  minHeight: "120px",
};

const createButtonContainer = {
  display: "flex",
  justifyContent: "flex-end",
};

const createButtonStyle = {
  padding: "1rem 2rem",
  backgroundColor: "#0d47a1",
  color: "#ffffff",
  border: "none",
  borderRadius: "8px",
  cursor: "pointer",
  fontWeight: "600",
  fontSize: "1rem",
  transition: "background 0.3s ease",
};

export default NewTicketForm;
